import PageRoutes from "./routes";
import Navigation from "./components/navigation/Navigation";

function Header() {
   <div className={classes.header}>
      <div className={classes.headerTop}>
         <div className={classes.logo}>Falling Book</div>
      </div>
      <Navigation />
   </div>;
}

function App() {
   return (
      <>
         <Header />
         <PageRoutes />
      </>
   );
}

export default App;
